function Task({ task }) {

    console.log(task)

    function completeTask() {
        fetch("http://localhost:9292/tasks", {
            method: 'DELETE',
        })
    }

    return (
        <div>
            <p className="singletasks">{task.name}</p>
            <button onClick={completeTask}>✔️</button>
        </div>
    )
}

export default Task
